        {
            src: 'images/PXP-0982.jpg'
        },
        {
            src: 'images/PXP-0982.jpg'
        },
        {
            src: 'images/PXP-0982.jpg'
        },
        {
            src: 'images/PXP-0982.jpg'
        },
    ]
    
  return (
    <div>
        {
            imageArray.map((image, index) => {
                <div key={index}>
                    <img src={imageArray[index].src} style={{width: '300px', height: '300px'}}/>
                </div>
            })
        }
    </div>
  )
}

export default Gallery
